PREFIX dblp: <https://dblp.org/rdf/schema#>
ASK WHERE {
  <https://dblp.org/rec/conf/icapr/WangL05> dblp:authoredBy <https://dblp.org/pid/l/GrahamLeedham> .
  <https://dblp.org/rec/conf/icapr/WangL05> dblp:authoredBy <https://dblp.org/pid/w/LingyuWang2> .
}

PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
PREFIX dblp: <https://dblp.org/rdf/schema#>
ASK WHERE {
  <https://dblp.org/rec/conf/recomb/SongL06> dblp:yearOfPublication "2007" ^^ xsd:gYear .
}

PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
PREFIX dblp: <https://dblp.org/rdf/schema#>
SELECT ( SUM( ?count ) AS ?totalPapers ) WHERE {
  {
    SELECT ( COUNT( DISTINCT ?paper ) AS ?count ) WHERE {
      ?paper dblp:authoredBy <https://dblp.org/pid/164/3309> ; dblp:yearOfPublication "2016" ^^ xsd:gYear .
    }
  } UNION {
    SELECT ( COUNT( DISTINCT ?paper ) AS ?count ) WHERE {
      ?paper dblp:authoredBy <https://dblp.org/pid/184/6425> ; dblp:yearOfPublication "2016" ^^ xsd:gYear .
    }
  } UNION {
    SELECT ( COUNT( DISTINCT ?paper ) AS ?count ) WHERE {
      ?paper dblp:authoredBy <https://dblp.org/pid/q/MeikangQiu> ; dblp:yearOfPublication "2016" ^^ xsd:gYear .
    }
  }
}

PREFIX dblp: <https://dblp.org/rdf/schema#>
SELECT ?wikidataID WHERE {
  <https://dblp.org/pid/o/AJeffersonOffutt> dblp:wikidata ?wikidataID .
}

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX dblp: <https://dblp.org/rdf/schema#>
SELECT ?venue ?venueLabel WHERE {
  <https://dblp.org/rec/journals/jlp/ShieberSP95> dblp:publishedIn ?venue .
  OPTIONAL {
    ?venue rdfs:label ?venueLabel
  }
}

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX dblp: <https://dblp.org/rdf/schema#>
SELECT DISTINCT ?venue ?venueLabel WHERE {
  {
    ?pub dblp:authoredBy <https://dblp.org/pid/19/2932-1> .
    ?pub dblp:publishedInStream ?venue .
    FILTER ( ?pub != <https://dblp.org/rec/conf/fgcn/ChenZXSS08> )
  } UNION {
    ?pub dblp:authoredBy <https://dblp.org/pid/236/3060> .
    ?pub dblp:publishedInStream ?venue .
    FILTER ( ?pub != <https://dblp.org/rec/conf/fgcn/ChenZXSS08> )
  } UNION {
    ?pub dblp:authoredBy <https://dblp.org/pid/40/4160> .
    ?pub dblp:publishedInStream ?venue .
    FILTER ( ?pub != <https://dblp.org/rec/conf/fgcn/ChenZXSS08> )
  } UNION {
    ?pub dblp:authoredBy <https://dblp.org/pid/40/4731> .
    ?pub dblp:publishedInStream ?venue .
    FILTER ( ?pub != <https://dblp.org/rec/conf/fgcn/ChenZXSS08> )
  } UNION {
    ?pub dblp:authoredBy <https://dblp.org/pid/55/2484-1> .
    ?pub dblp:publishedInStream ?venue .
    FILTER ( ?pub != <https://dblp.org/rec/conf/fgcn/ChenZXSS08> )
  }
  OPTIONAL {
    ?venue rdfs:label ?venueLabel
  }
}
ORDER BY ?venueLabel

PREFIX dc: <http://purl.org/dc/elements/1.1/>
PREFIX dblp: <https://dblp.org/rdf/schema#>
SELECT DISTINCT ?paper ?title WHERE {
  ?paper dblp:authoredBy <https://dblp.org/pid/63/10539> .
  OPTIONAL {
    ?paper dc:title ?title
  }
}

PREFIX dblp: <https://dblp.org/rdf/schema#>
SELECT ( COUNT( ?paper ) AS ?paperCount ) WHERE {
  ?paper dblp:authoredBy <https://dblp.org/pid/21/4802> .
}

PREFIX dblp: <https://dblp.org/rdf/schema#>
SELECT ?paper ?numAuthors WHERE {
  VALUES ?paper {
    <https://dblp.org/rec/journals/tcyb/MaB21> <https://dblp.org/rec/conf/etfa/Missal0H07>
  }
  ?paper dblp:numberOfCreators ?numAuthors .
}

PREFIX dblp: <https://dblp.org/rdf/schema#>
SELECT ?pub ?year WHERE {
  ?pub dblp:authoredBy <https://dblp.org/pid/286/6829> ; dblp:yearOfPublication ?year .
  FILTER ( ?year >= 2022 )
}
LIMIT 1

PREFIX dblp: <https://dblp.org/rdf/schema#>
SELECT ?publication WHERE {
  ?publication dblp:author <https://dblp.org/pid/p/JianPei> .
  ?publication dblp:series <https://dblp.org/streams/conf/icdm> .
}
LIMIT 10

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX dblp: <https://dblp.org/rdf/schema#>
SELECT ?venue ?venueLabel WHERE {
  <https://dblp.org/rec/conf/isgv/ZouWW021> dblp:publishedIn ?venue .
  OPTIONAL {
    ?venue rdfs:label ?venueLabel
  }
}

PREFIX dblp: <https://dblp.org/rdf/schema#>
SELECT ?title ?year WHERE {
  VALUES ?pub {
    <https://dblp.org/rec/journals/cga/Kroeker02> <https://dblp.org/rec/conf/pldi/PhuliaBB20>
  }
  ?pub dblp:title ?title ; dblp:yearOfPublication ?year .
}
ORDER BY ?year

PREFIX dblp: <https://dblp.org/rdf/schema#>
SELECT ( COUNT( ?paper ) AS ?totalPapers ) ( COUNT( DISTINCT ?year ) AS ?distinctYears ) WHERE {
  ?paper dblp:authoredBy <https://dblp.org/pid/45/1135> ; dblp:yearOfPublication ?year .
}

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX dblp: <https://dblp.org/rdf/schema#>
SELECT ?venueLabel ?year WHERE {
  <https://dblp.org/rec/journals/corr/abs-2201-12082> dblp:publishedInStream ?venue ; dblp:yearOfPublication ?year .
  ?venue rdfs:label ?venueLabel .
}

PREFIX dblp: <https://dblp.org/rdf/schema#>
SELECT ?orcid WHERE {
  <https://dblp.org/pid/p/FriedrichPillichshammer> dblp:orcid ?orcid .
}

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX dblp: <https://dblp.org/rdf/schema#>
SELECT ?venueLabel ?year WHERE {
  <https://dblp.org/rec/conf/icassp/MeillierC91> dblp:publishedInStream ?venue .
  OPTIONAL {
    ?venue rdfs:label ?venueLabel .
  }
  <https://dblp.org/rec/conf/icassp/MeillierC91> dblp:yearOfPublication ?year .
}

