PREFIX dblp: <https://dblp.org/rdf/schema#>
SELECT ?paper ?title WHERE {
  ?paper dblp:title ?title .
  FILTER ( CONTAINS( LCASE( ?title ) , "decision diagram" ) ) ?paper dblp:publishedInStream <https://dblp.org/rec/conf/aspdac/1997> .
}

PREFIX dblp: <https://dblp.org/rdf/schema#>
ASK WHERE {
  ?paper dblp:title ?title ; dblp:author <https://dblp.org/pid/80/2691> .
  FILTER ( CONTAINS( LCASE( ?title ) , "an fptas for quickest multicommodity flows with inflow-dependent transit times" ) )
}

PREFIX dblp: <https://dblp.org/rdf/schema#>
SELECT ?author WHERE {
  <https://dblp.org/rec/journals/nar/KanzAABBBBBCCDEFGDHKLLLMMNSSSTTVWZA05> dblp:authoredBy ?author .
}

PREFIX dblp: <https://dblp.org/rdf/schema#>
SELECT DISTINCT ?publication ?title WHERE {
  ?publication dblp:author <https://dblp.org/pid/71/2077> .
  ?publication dblp:journal <https://dblp.org/streams/journals/firai> .
  OPTIONAL {
