PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
PREFIX dblp: <https://dblp.org/rdf/schema#>
SELECT ?paper ?title WHERE {
  ?paper dblp:series <https://dblp.org/streams/conf/hpc2> ; dblp:year "2003" ^^ xsd:gYear ; dblp:title ?title .
  FILTER ( CONTAINS( LCASE( ?title ) , "overlay multicast" ) )
}

PREFIX dblp: <https://dblp.org/rdf/schema#>
SELECT DISTINCT ?paper WHERE {
  ?paper a dblp:Publication .
  FILTER NOT EXISTS {
    ?paper dblp:author <https://dblp.org/pid/60/161> .
    ?paper dblp:author <https://dblp.org/pid/77/10786> .
  }
}
LIMIT 10

PREFIX dblp: <https://dblp.org/rdf/schema#>
PREFIX foaf: <http://xmlns.com/foaf/0.1/>
SELECT ?authorName ?affiliation WHERE {
  VALUES ?author {
    <https://dblp.org/pid/02/3102> <https://dblp.org/pid/11/2423> <https://dblp.org/pid/35/9982> <https://dblp.org/pid/74/115>
  }
  ?author foaf:name ?authorName .
  OPTIONAL {
    ?author dblp:affiliation ?affiliation
  }
}

