SELECT ?bibtexType WHERE {
  <https://dblp.org/rec/conf/huc/KanamitsutN0SY21> dblp:bibtexType ?bibtexType
}

PREFIX dblp: <https://dblp.org/rdf/schema#>
SELECT ?orcid WHERE {
  <https://dblp.org/pid/79/5370> dblp:orcid ?orcid
}

PREFIX dblp: <https://dblp.org/rdf/schema#>
SELECT ?wikidataID WHERE {
  <https://dblp.org/pid/k/VladikKreinovich> dblp:wikidata ?wikidataID .
}

PREFIX dblp: <https://dblp.org/rdf/schema#>
SELECT ?paper ?title ( COUNT( DISTINCT ?author ) AS ?authorCount ) WHERE {
  VALUES ?paper {
    <https://dblp.org/rec/journals/dam/CheonK08> <https://dblp.org/rec/conf/humanoids/ChestnuttK04>
  }
  ?paper dblp:title ?title .
  ?paper dblp:authoredBy ?author .
}
GROUP BY ?paper ?title

PREFIX dblp: <https://dblp.org/rdf/schema#>
PREFIX foaf: <http://xmlns.com/foaf/0.1/>
SELECT ?authorName WHERE {
  <https://dblp.org/rec/conf/socs/SvancaraOHBS22> dblp:author ?author .
  ?author foaf:name ?authorName .
}

PREFIX dc: <http://purl.org/dc/elements/1.1/>
PREFIX dblp: <https://dblp.org/rdf/schema#>
SELECT ?paper ?title ?year WHERE {
  ?paper dblp:authoredBy <https://dblp.org/pid/s/RichardEdwinStearns> .
  ?paper dblp:yearOfPublication ?year .
  FILTER ( ?year >= 2021 ) .
  OPTIONAL {
    ?paper dc:title ?title
  }
}
ORDER BY DESC ( ?year )

PREFIX dblp: <https://dblp.org/rdf/schema#>
SELECT DISTINCT ?publication ?title WHERE {
  {
    ?publication dblp:createdBy <https://dblp.org/pid/199/9664>
  } UNION {
    ?publication dblp:authoredBy <https://dblp.org/pid/199/9664>
  }
  OPTIONAL {
    ?publication dblp:title ?title
  }
}

PREFIX dblp: <https://dblp.org/rdf/schema#>
SELECT ?author1 ?author2 WHERE {
  <https://dblp.org/rec/journals/tnn/Liang01> dblp:author ?author1 .
  <https://dblp.org/rec/journals/jsw/LiuLCGY09> dblp:author ?author2 .
  FILTER ( ?author1 = ?author2 )
}

PREFIX dblp: <https://dblp.org/rdf/schema#>
SELECT ?year WHERE {
  <https://dblp.org/rec/conf/ecis/CzapH95> dblp:yearOfPublication ?year .
}
